import Jumbotron from "react-bootstrap/Jumbotron";
import { Modal, Button } from "react-bootstrap";
import { useState } from "react";
import Video from "./video/Video";

const Main = () => {
  function ModalBootstrap() {
    const [show, setShow] = useState(false);

    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);

    return (
      <>
        <Jumbotron className="contenedor_jumbo">
          <div className="ventana_textos_jumbo">
            <div>
              <h1>CREATEUR</h1>
              <p className="h5">DE COMBINAISONS DE PLONGEE PERSONNALISABLES</p>
              <p className="font-weight-bold h6">MADE IN FRANCE</p>
              <p>
                <Button variant="primary" onClick={verVideo}>
                  Connais nous
                </Button>
              </p>
            </div>
          </div>
        </Jumbotron>
        <Button variant="primary" onClick={handleShow}>
          Launch demo modal
        </Button>
        <Modal show={show} onHide={handleClose}>
          <Modal.Header closeButton>
            <Modal.Title>{<Video />}</Modal.Title>
          </Modal.Header>
        </Modal>
      </>
    );
  }
};
export default Main;
